sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if (inputs.ip_address!="" && inputs.ip_address.match(/^(?:[0-9]{1,3}\.){3}[0-9]{1,3}$/)){
  	outputs.path="assetBasicInfo.ipAddress";
    outputs.value=inputs.ip_address;
  } else if (inputs.mac_address!="" && inputs.mac_address.match(/^[0-9a-f]{1,2}([\.:-])(?:[0-9a-f]{1,2}\1){4}[0-9a-f]{1,2}$/i)){
    outputs.path="assetBasicInfo.mac";
    outputs.value=inputs.mac_address;
  }else {
    throw 'Error invalid input. IP address or MAC is not valid'
  	outputs.path=null;
    outputs.value=null;
  }
})(inputs, outputs);

